    const [data, setData] = useState([]);
    return (
        <>
       <div className='App'>
        <Router> 

                <Navbar/>
                 {/* <LandingPage/>  */}
                <Routes classname='main'>
                    <Route path="/" element={<LandingPage data={data} setData={setData} />} />   
